/*get rendered based on width*/
function getRendered(){
	var dtype = 'Unknown';
	var dw = document.documentElement.clientWidth;
	if(dw >= 320 && dw <= 568) {
	  dtype = "Smartphone"
	}else if(dw >= 600 && dw <= 800) {
	  dtype = "Small Tablet";
	}else if(dw >= 768 && dw <= 1024) {
	  dtype = "Tablet";
	}else if(dw >= 1280 && dw <= 800) {
	  dtype = "Widescreen TV | Laptop";
	}else if (dw >= 1280) {
	  dtype = "Desktop | Large TV";
	}else{
	  dtype = "Unknown";
	}
	return dtype;
};


